import React from "react";
import { Link } from "react-router-dom";
import GoogleAuth from "./GoogleAuth";

const Header = () => {
  return (
    <React.Fragment>
      <div className="ui secondary pointing menu">
        <Link to="/" className="item">
          Streamy
        </Link>
        <div className="right menu">
          <Link to="/" className="item">
            All streams
          </Link>
          <GoogleAuth />
        </div>
      </div>
    </React.Fragment>
  );
};

export default Header;
